import React from "react";
import { Outlet, Link } from "react-router-dom";

const Navigation = () => {
  return (
    <div>
      <nav className="site-navigation">
        <ul>
          <li>
            <Link>Home</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Navigation;
